import React, { Component } from "react";
import BurgerMenue from "../components/BurgerMenue";
import UserLogIn from "../components/UserLogIn";

class Header extends Component {
  render() {
    return (
      <div className="Header">
        <UserLogIn />
        <BurgerMenue />
      </div>
    );
  }
}

export default Header;
